def tri(n):
    tribonacci = [3]
    if n == 0:
        return tribonacci
    tribonacci.append(1)
    if n == 1:
        return tribonacci
    tribonacci.append(2)
    if n == 2:
        return tribonacci
    for i in range(3, n + 1):
        if i % 2 == 0:
            tribonacci.append(1 + i // 2)
        else:
            tribonacci.append(tribonacci[i - 1] + tribonacci[i - 2] + tribonacci[i - 3])
    return tribonacci

def largest_smallest_integers(lst):
    neg_integers = [num for num in lst if num < 0]
    pos_integers = [num for num in lst if num > 0]

    largest_neg = max(neg_integers) if neg_integers else None
    smallest_pos = min(pos_integers) if pos_integers else None

    if not neg_integers and not pos_integers:
        return (None, None)
    elif not neg_integers:
        return (None, smallest_pos)
    elif not pos_integers:
        return (largest_neg, None)

    return (largest_neg, smallest_pos) if largest_neg is not None and smallest_pos is not None else (None, None)

def get_max_triples(n):
    count = 0
    for i in range(1, n+1):
        a_i = i * i - i + 1
        for j in range(i+1, n+1):
            a_j = j * j - j + 1
            for k in range(j+1, n+1):
                a_k = k * k - k + 1
                if (a_i + a_j + a_k) % 3 == 0:
                    count += 1
    return count

